import SignIn from "./SignIn/SignIn";
import SignUp from "./SignUp/SignUp";

const AllRoutes = [
    {
        path: "/signin",
        component: SignIn,
    },
    {
        path: "/signup",
        component: SignUp,
    },
];

export default AllRoutes;
